import React from 'react';
import home from "./img/home.jpg";
import sofa from "./img/sofa.jpg";
import chair from "./img/chair.jpg";
import beauty from "./img/beauty.png";
import sunglasses from "./img/sunglasses.png";
import jackets from "./img/jackets.png";
import shoe from "./img/shoe.png";
import other from "./img/other.jpg";
import wave from "./img/wave.jpg";
import light from "./img/light.png";
import kitchen from "./img/kitchen.png";
import headphones from "./img/headphones.png";

const Main = () => {
    return (
        <>

               <div className="row col-md-12 px-2">
                   <img src={home} alt="" />
               </div>

               <div className="row col-md-12 my-5">
                   <div className="col-md-6 left-item">
                        <img src={sofa} alt="" width="300px" />
                        <h3 className="pt-5">New collection available now</h3>
                        <button className="btn btn-outline-primary d-block">View All</button>
                   </div>
                   <div className="col-md-6 d-flux right-item">
                        <img src={chair} alt="" width="300px" />
                        <h3>Redifining the modern desigh</h3>
                        <button className="btn btn-outline-primary">Check All</button>
                   </div>
               </div>

               {/* ---------Main Category ---------- */}

               <section className="row text-center">
                   <div className="col-md-2 offset-md-2">
                     <img src={beauty} alt="" width="200px" height="300px" />
                     <h3>Beauty</h3>
                   </div>
                   <div className="col-md-2">
                     <img src={sunglasses} alt="" width="200px" height="300px" />
                     <h3> Sunglasses </h3>
                   </div>
                   <div className="col-md-2">
                     <img src={jackets} alt="" width="200px" height="300px" />
                     <h3>Jackets</h3>
                   </div>
                   <div className="col-md-2">
                     <img src={shoe} alt="" width="200px" height="300px" />
                     <h3>Shoe</h3>
                   </div>
               </section>
{/* ------------ Carousel Section ----------- */}
               <section className="row">
                   <div className="col-md d-flux">
                       <img src={other} alt="" width="300px" height="400px" className="img-fluid" />
                       <img className="" src={shoe} alt="First slide" />
                       <img className="" src={kitchen} alt="Second slide" />
                       <img className="" src={headphones} alt="Third slide" />
                   </div>
               </section>
{/* ------------ Vedio Section ------------- */}
               <section className="row text-center">
                <div className="embed-responsive embed-responsive-16by9 ">
                <iframe className="embed-responsive-item w-75 h-100" src="https://www.youtube.com/embed/zpOULjyy-n8?rel=0" allowfullscreen></iframe>
                </div>
               </section>

{/* ---------- Footer ---------- */}
               <section className="row">
                   <img src={wave} alt="" className="img-fluid" />
               </section>

        </>
    )
}

export default Main;
